Label from the library of the Collegio San Lorenzo da Brindisi (Rome, Italy):
&quot;Collegium S. Laurentii a Brundusio Romae Bibliotheca&quot;

The Central library of the Order of Capuchin Friars Minor (Biblioteca Centrale dei Fratri Minori Cappuccini) in Rome was established in the second half of the 19th century; it gradually grew with the acquisition of the libraries of Saint Fidelis College for the Missions (Biblioteche del Collegio San Fedele per le Missioni 1911), of the Franciscan Museum (1912) and of the Historical Institute of the Order (1940).

