Ms. inscription of W.[?] May: &quot;This beautiful copy of  Geoffrey of Manmouth was given me in 1815 by Mr. Verbist[?] a very clever bookseller near the Poids de la Ville at Brussells. He has amassed[?] during the French Revolution an immense collection of valuable books at a very cheap rate as merely an amateur of [...] as he told me. But from the idle habits of a Biblomaniac he became a [...] in wisdom and a most agreeable fellow he was. I scarcely could get out of his house at any time without his obliging me to deposit under my belt at least a pint of his very fine wine of which he had a large &amp; various stock- among the rest we used to be  [..] over come very curious  [...]&quot;

Perhaps the inscription refers to Jan Baptiste Verbeyst (1770-1849),  a well-known bookseller in Brussels.
