Geo. T. Davidson from Father

[Ms. inscription recording the gift of this book from Matthias Oliver Davidson to his son George Trimble Davidson (b. 1863), an American lawyer and notable member of New York society (cf. his <a href="http://books.google.com/books?id=I-I-AAAAYAAJ&amp;lpg=PA347&amp;ots=G25rE6XbPs&amp;dq=george trimble davidson&amp;pg=PA347#v=onepage&amp;q&amp;f=false" rel="nofollow">entry</a> in <i>The National Cyclopaedia of American Biography</i>, v. 4 (New York: J. White &amp; Co., 1893).  The younger Davidson took his law degree from Columbia in 1885 and may have been accused of misappropriation of funds in 1901 (cf. &quot;Suit Over Trust Fund&quot; in <i>The New York Times</i> 4 June 1901, p. 5).  His appearances in the society pages were happier.  According to his <a href="http://archive.org/stream/leslieshistoryof02vanpa#page/247/mode/1up" rel="nofollow">entry</a> in <i>Leslie's History of the Greater New York</i>, he was &quot;prominent in the arrangement of a number of high social affairs,&quot; including the reception of the <a href="http://en.wikipedia.org/wiki/Infanta_Eulalia_of_Spain" rel="nofollow">Infanta Eulalia of Spain</a>, at which his behavior was cause for note in the <i>New York Times</i> of 28 May 1893 (p. 5):<blockquote>The members of the Committee of One Hundred were much amused at the behavior of one of their number, George Trimble Davidson.  On the day that the Princess arrived Mr. Davidson took her hand and impressed upon it a kiss.  At the ball Mr. Davidson, according to the story of one who witnessed it, approached the Infanta beaming.

&quot;How are you, Princess?&quot; he said.  &quot;You remember me, don't you?  I am the man who first kissed your hand at the reception yesterday.&quot;

Later, as the Princess was coming slowly down the room at the head of the procession, Mr. Davidson approached her and, touching her slightly on the arm, said; &quot;Princess, allow me to introduce a friend of mine.  

The whole procession stopped and, as the Infanta looked a little surprised, Mr. Davidson continued:  &quot;You remember me, don't you?&quot;

The Princess smiled, Mr. Davidson looked supremely happy, and the procession moved on.</blockquote>  He is likely the author of <i> The Moderns: A Tale of New York</i> (New York: Stokes, 1901), favorably reviewed as &quot;just the thing for summer reading&quot; in <i>The Public Library Bulletin</i> 1.2 (August 1901), p. <a href="http://books.google.com/books?id=rng6AQAAIAAJ&amp;lpg=PA34&amp;ots=xXAnWsp_pB&amp;dq=&quot;George Trimble Davidson&quot; &quot;The Moderns&quot;&amp;pg=PA34#v=onepage&amp;q=&quot;George Trimble Davidson&quot; &quot;The Moderns&quot;&amp;f=false" rel="nofollow">34</a>.  Among his other distinctions, a <a href="http://www.karipearls.com/oyster-recipes.html" rel="nofollow">recipe for oysters</a> bears his name.]

